window.bookSummaryJSON = "<p><b>The Black King has set his sights on Nyro, and it’s not for the better.</b></p> <p>Nyro’s ambitious plan to rescue his brother has failed, and now, every member of the Board sees him as a traitor. But, against all odds, he’s still alive, and while there is breath left in him, there is hope.</p> <p>Now, his goal is to find his brother again and make another plan for escape. He must learn all he can about the Black Court, its weaknesses, and secrets. And while he prowls, he hopes to create enough chaos to undermine the Board from within. What he never expects, however, is his own maneuvering to fire back.</p> <p><b>Immerse yourself in Vampire Court, an addicting fantasy series by </b><b><i>USA Today</i></b><b> best-selling author Ingrid Seymour!</b></p>"; 
